import React, { useState, useEffect } from 'react';
import './air_condition.css'; // Import the updated CSS file
import HeatIcon from './hot.png'; 
import SnowflakeIcon from './snowflake.png'; 
import AutoIcon from './letter-a.png'; 
import ClockIcon from './clock.png'; 
import ThermometerIcon from './thermometer.png'; 

export function AirCondition({ pageTitle }) {
  const [mainData, setMainData] = useState(null);
  const [filteredData, setFilteredData] = useState([]);
  const [error, setError] = useState(null);

  const apiBaseUrl = 'http://192.168.1.7:5000'; // Update to your Flask server URL

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(`${apiBaseUrl}/stream_air_condition`);
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        const reader = response.body.getReader();
        const decoder = new TextDecoder();
        let dataBuffer = '';

        reader.read().then(function processText({ done, value }) {
          if (done) {
            console.log('Stream finished');
            return;
          }
          dataBuffer += decoder.decode(value, { stream: true });

          const lines = dataBuffer.split('\n\n');
          lines.forEach(line => {
            if (line.trim().startsWith('data: ')) {
              const jsonData = JSON.parse(line.replace('data: ', ''));
              setMainData(jsonData);
              // Assuming that air_condition data will be part of the mainData
              if (jsonData.air_condition_logs) {
                setFilteredData(jsonData.air_condition_logs);
              }
            }
          });
          dataBuffer = lines.pop(); // Keep the last incomplete line
          reader.read().then(processText);
        });
      } catch (error) {
        setError('Error fetching data: ' + error.message);
      }
    };

    fetchData();
    const intervalId = setInterval(fetchData, 5000);

    return () => clearInterval(intervalId);
  }, [apiBaseUrl]);

  const formatTime = (time) => {
    return time ? `${time}'` : 'N/A';
  };

  const renderAirConditionCard = (property, value) => {
    let statusClass = '';
    let icon = null;

    if (property === 'On/Off') {
      statusClass = value.toLowerCase() === 'on' ? 'on' : 'off';
    }

    if (property === 'Mode' && value === 'heat') {
      icon = HeatIcon;
    } else if (property === 'Mode' && value === 'cold') {
      icon = SnowflakeIcon;
    } else if (property === 'Mode' && value === 'auto') {
      icon = AutoIcon;
    } else if (property === 'Timer') {
      icon = ClockIcon;
    } else if (property === 'Temperature') {
      icon = ThermometerIcon;
    }

    return (
      <div className={`air-condition-card ${statusClass}`}>
        <div className="air-condition-card-content">
          {statusClass && <div className={`air-condition-status-circle ${statusClass}`}></div>}
          {icon && <img src={icon} alt={`${property} Icon`} className="air-condition-icon" />}
          <div className="air-condition-info">
            <div className="air-condition-property">{property}</div>
            <div className="air-condition-value">
              {property === 'Temperature' ? `${value}Â°C` : property === 'Timer' ? formatTime(value) : value}
            </div>
          </div>
        </div>
      </div>
    );
  };

  if (error) {
    return <p className="text-center" style={{ color: 'red' }}>{error}</p>;
  }

  return (
    <div className="air-condition-page-container">
      <div className="header">
        <h1>{pageTitle}</h1>
        <hr className="line-under-header" />
      </div>
      {mainData ? (
        <div className="air-condition-cards-container">
          {renderAirConditionCard('On/Off', mainData.on_off || 'N/A')}
          {renderAirConditionCard('Temperature', mainData.temperature || 'N/A')}
          {renderAirConditionCard('Timer', mainData.timer || 'N/A')}
          {renderAirConditionCard('Mode', mainData.mode || 'N/A')}
        </div>
      ) : (
        <p>Loading data...</p>
      )}

      {filteredData.length > 0 && (
        <div className="tables-container">
          <div className="table-container-wrapper">
            <h2>Air Condition Information</h2>
            <div className="table-container">
              <table className="table-container2">
                <thead>
                  <tr className="row_0">
                    <th>Original Text</th>
                    <th>NLP Text</th>
                    <th>Device</th>
                    <th>Flag</th>
                    <th>Time</th>
                  </tr>
                </thead>
                <tbody>
                  {filteredData.slice().reverse().map((item, index) => (
                    <tr key={index}>
                      <td>{item.original_text}</td>
                      <td>{item.nlp_text}</td>
                      <td>{item.device}</td>
                      <td>{item.flag}</td>
                      <td>{item.time}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default AirCondition;
